import React from "react";
import { Link } from "react-router-dom";
const Menu=()=>{
return(
    <>
    <Link to='/'>About Us</Link>
    <Link to='/contact'>Contact Us</Link>
       <a href="/">About us</a>
       <a href="/contact">Contact us</a>
    </>
);

}
export default Menu;
